import { TODO_ADD, TODO_DELETE, TODO_LIST_GET } from "./types";


function Reducer(state = { todolist: [] }, action) {
    console.log(action);
    switch (action.type) {
        case TODO_ADD:
            return state;
        case TODO_DELETE:
            return state;
        case TODO_LIST_GET:
            return { ...action.payload };
        default:
            return state;
    }
}

export default Reducer;
